CREATE TABLE `crops` (  `crop_id` INT NOT NULL AUTO_INCREMENT,  `crop_name` VARCHAR(100) NOT NULL,  `region_id` INT NOT NULL,  `year` INT NOT NULL,  `yield` DECIMAL(8, 2) NOT NULL,  PRIMARY KEY (`crop_id`),  FOREIGN KEY (`region_id`) REFERENCES `regions`(`region_id`));
CREATE TABLE `regions` (  `region_id` INT NOT NULL AUTO_INCREMENT,  `region_name` VARCHAR(100) NOT NULL,  PRIMARY KEY (`region_id`));
CREATE TABLE `farms` (  `farm_id` INT NOT NULL AUTO_INCREMENT,  `farm_size` INT NOT NULL,  `region_id` INT NOT NULL,  `year` INT NOT NULL,  PRIMARY KEY (`farm_id`),  FOREIGN KEY (`region_id`) REFERENCES `regions`(`region_id`));
CREATE VIEW `crop_yields_by_farm_size` AS  SELECT  `c`.`crop_name`,  `r`.`region_name`,  `f`.`farm_size`,  `c`.`yield` AS `crop_yield` FROM  `crops` AS `c`  JOIN `regions` AS `r` ON `c`.`region_id` = `r`.`region_id`  JOIN `farms` AS `f` ON `c`.`region_id` = `f`.`region_id` AND `c`.`year` = `f`.`year`;

CREATE TABLE `crops` (  `crop_id` INT NOT NULL AUTO_INCREMENT,  `crop_name` VARCHAR(100) NOT NULL,  `region_id` INT NOT NULL,  `year` INT NOT NULL,  `yield` DECIMAL(8, 2) NOT NULL,  `farming_practice` VARCHAR(50) NOT NULL,  PRIMARY KEY (`crop_id`),  FOREIGN KEY (`region_id`) REFERENCES `regions`(`region_id`));
CREATE TABLE `regions` (  `region_id` INT NOT NULL AUTO_INCREMENT,  `region_name` VARCHAR(100) NOT NULL,  PRIMARY KEY (`region_id`));
CREATE TABLE `resources` (  `resource_id` INT NOT NULL AUTO_INCREMENT,  `resource_name` VARCHAR(100) NOT NULL,  `region_id` INT NOT NULL,  `year` INT NOT NULL,  `amount_used` DECIMAL(8, 2) NOT NULL,  PRIMARY KEY (`resource_id`),  FOREIGN KEY (`region_id`) REFERENCES `regions`(`region_id`));

