SELECT AVG(Bedrooms) AS Average_Bedrooms, AVG(Bathrooms) AS Average_Bathrooms
FROM CA_Single_Family_Homes_Sales
WHERE Property_Type = 'Single Family Residence' AND Sale_Date >= DATEADD(year, -1, GETDATE()) AND Sale_Price > 1000000;

SELECT AVG((Sale_Price - Purchase_Price) * 100.0 / Purchase_Price) AS Average_ROI
FROM US_Residential_Real_Estate_Investments
WHERE Sale_Date >= DATEADD(year, -10, GETDATE());

