sql:
SELECT machine_name, scheduled_maintenance_date FROM (
  SELECT machine_name, DATE_ADD(last_maintenance_date, INTERVAL maintenance_interval DAY) AS scheduled_maintenance_date
  FROM machines
) AS scheduled_maintenance
WHERE scheduled_maintenance_date BETWEEN CURDATE() AND DATE_ADD(CURDATE(), INTERVAL 30 DAY);

